import React from "react"

const Navbar = () => {
    const links = [
        {
            id: 1,
            path: "/",
            text: "Home",
        },
        {
            id: 2,
            path: "/about",
            text: "About",
        },
    ]
    return <div>Hello from Navbar</div>
}
export default Navbar
